INSERT INTO `product` (`product_id`, `product_name`, `category_id`, `product_title`, `product_intro`, `product_picture`, `product_price`, `product_selling_price`, `product_num`, `product_sales`) VALUES (1, 'SUPBRO LED SOUND ACTIVE SNEAKER CASE', 1, 'SupBro', '<h1>SUPBRO LED SOUND ACTIVE SNEAKER CASE</h1>\n<br>\n<h2>The wireless charger feature is not equipped for the current version.</h2>\n<br>\n<h2>Box only, no shoes! </h2>\n<br>\n<h2>Advantage:</h2>\n<br>\n<h2>	1.LED sound activation, use technology and creativity to make your shoe collection a superstar.</h2>\n<br>\n<h2>	2.Three switchable modes: no light/steady light/sound activation (LED turns off automatically after 60 seconds).</h2>\n<br>\n<h2>	3.One of the largest shoe display boxes on the market, which can accommodate shoes up to US16.</h2>\n<br>\n<h2>	4.The wireless joint power supply connection design between each box, the single charger can supply power for up to 20 shoe boxes at the same time.</h2>\n<br>\n<h2>	5.The high-quality acrylic material and the door panel equipped with 2 powerful magnets can reduce the oxidation speed of your sneakers, thereby extending the life of them.</h2>\n<br>', 'public/imgs/homeImg/one.png', 188, 188, 0, 0);
INSERT INTO `product` (`product_id`, `product_name`, `category_id`, `product_title`, `product_intro`, `product_picture`, `product_price`, `product_selling_price`, `product_num`, `product_sales`) VALUES (2, 'SAMPLESTOCK RUGS - PINK DUNK', 1, 'SupBro', ' <h1>AS A TRUE SNEAKER LOVER, A UNIQUE SNEAKER CULTURE HOME DECORATION IS ALSO ESSENTIAL. CARPETS CAN WELL DECORATE YOUR DRESSING ROOM OR WORKROOM, MAKING THE ENVIRONMENT ARTISTIC. OF COURSE, OUR PURSUIT OF QUALITY IS ALSO VERY STRICT, AND AS FAR AS POSSIBLE TO MAKE PRODUCTS MORE DURABLE. HIGH-QUALITY ANTI-SKID PARTICLES CAN ENSURE THAT THE CARPET IS SAFER AND MORE CONVENIENT DURING USE. EACH CARPET HAS A CUSTOM-MADE CANVAS DUST JACKET.</h1>\n        <br>\n        <h1>TWO SIZES: 60CM X 90CM AND 120CM X 160CM\n          MADE FROM A WOVEN, POLYESTER CHENILLE\n          THE ONLY TOPSIDE IS PRINTED WITH A DESIGN\n          BACKING MADE FROM A DURABLE COTTON/POLY CANVAS</h1>\n        <br>\n        <h1>EASY TO CLEAN. SIMPLY VACUUM AND WIPE WITH SOAP, WATER, AND NON-ABRASIVE CLOTH</h1>\n        <br>\n        <h1>EVERY ORDER IS CUSTOM MADE JUST FOR YOU</h1>\n        <br>\n        <br>\n        <p>TIP: Rugs are one of the best, attention-grabbing pieces to design a room around. Use the colors within the rug to help choose art prints, furniture fabric, and accent pillows.</p>\n  ', 'public/imgs/homeImg/two.png', 88, 88, 10, 0);
INSERT INTO `product` (`product_id`, `product_name`, `category_id`, `product_title`, `product_intro`, `product_picture`, `product_price`, `product_selling_price`, `product_num`, `product_sales`) VALUES (3, 'SUPBRO ESSENTIAL SNEAKER BOX (FRONT-DROP) - BLACK', 1, 'SupBro', '<h1>SUPBRO ACRYLIC SNEAKER DISPLAY BOX (MAGNETIC FRONT DOOR) - BLACK</h1>\n  <br>\n  <h2>L36CM X W28CM X H22CM (MAXIMUM SIZE: US13)</h2>\n  <br>\n  <h2>EXCLUSIVELY DESIGNED, DEVELOPED, AND PRODUCED BY SUPBRO, THE CHINESE BIGGEST SNEAKER CARE BRAND. </h2>\n  <br>\n  <h2>TIGHT PROTECTION\n    DUST-PROOF, MOISTURE-PROOF AND ANTI-OXIDATION DESIGN CAN PROTECT SHOES FROM DUST AND MOISTURE, AND THE BLACK APPEARANCE CAN PROTECT SHOES FROM OXIDATION CAUSED BY LIGHT. (HUMIDITY AND LIGHT ARE THE MAIN CAUSES OF SHOE OXIDATION)</h2>\n  <br>\n  <h2>THE SUPBRO SHOE BOX IS MADE OF HIGH-QUALITY ENVIRONMENTALLY FRIENDLY MATERIALS WITH A LIGHT TRANSMITTANCE OF UP TO 98%. IT CAN DISPLAY YOUR FAVORITE SHOES AT A 360-DEGREE ANGLE.</h2>\n  <br>\n  <h2>IT ONLY TAKES 3 STEPS TO PUT THE SHOE BOXES TOGETHER, AND IN JUST 15 SECONDS, YOU CAN EASILY SET UP THE SHOE BOXES.</h2>', 'public/imgs/homeImg/three.png', 128, 128, 20, 0);
INSERT INTO `product` (`product_id`, `product_name`, `category_id`, `product_title`, `product_intro`, `product_picture`, `product_price`, `product_selling_price`, `product_num`, `product_sales`) VALUES (4, 'SUPBRO \"LITE\" LED SOUND ACTIVE SNEAKER CASES', 1, 'SupBro', '<h1>SUPBRO LED SOUND ACTIVE SNEAKER DISPLAY CASES (LITE)</h1>\n<br>\n<h2>The wireless charger feature is not equipped for the current version.</h2>\n<br>\n<h2>Box only, no shoes!</h2>\n<br>\n<h2>Advantage:</h2>\n<br>\n<h2>	1.LED sound activation, use technology and creativity to make your shoe collection a superstar.</h2>\n<br>\n<h2>	2.Three switchable modes: no light/steady light/sound activation (LED turns off automatically after 60 seconds).</h2>\n<br>\n<h2>	3.One of the largest shoe display boxes on the market, which can accommodate shoes up to US16.</h2>\n<br>\n<h2>	4.The wireless joint power supply connection design between each box, the single charger can supply power for up to 20 shoe boxes at the same time.</h2>\n<br>\n<h2>	5.The high-quality acrylic material and the door panel equipped with 2 powerful magnets can reduce the oxidation speed of your sneakers, thereby extending the life of them.</h2>\n<br>', 'public/imgs/homeImg/four.png', 58, 58, 20, 0);
